INSERT INTO `home_pages` (`id`, `business_model_title`, `business_model_description`, `business_model_link`, `feature_title`, `feature_description`, `howitworks_title`, `howitworks_description`, `app_store_link`, `play_store_link`, `testimonial_title`, `testimonial_description`, `blogs_title`, `blogs_description`, `created_at`, `updated_at`) VALUES
(1, 'Process Flow for our business model', 'A smart accounting software for rental property landlords automates rental income tracking, expense management, and reporting for rental properties.', '#', 'Grab your software with amazing features', 'Real estate refers to the buying, selling, and renting of properties, including residential, commercial, and industrial buildings and land.', 'How it works?', 'Accounting software for rental landlords streamlines financial management by automating data entry, tracking income & expenses, generating reports.', '#', '#', 'Love from out clients around the world', 'Clients say our smart accounting software saves time, improves accuracy and simplifies reporting for rental property landlords.', 'Whatâ€™s New?', 'Our blog showcases the benefits of using a smart accounting software for rental property landlords, from streamlining financial management to saving time.', NULL, NULL);
INSERT INTO `how_it_works` (`id`, `title`, `message`, `image_id`, `status`, `bgcolor`, `color`, `created_at`, `updated_at`) VALUES
(1, 'Manage Property Listings', 'Managing property listings typically involves creating and updating listings for properties that are available for sale or rent, including details such as property type, location, features, price, and photos or videos.', NULL, 1, '#087c7c', '#fff', '2023-04-12 02:21:07', '2023-04-12 02:21:07'),
(2, 'Communicate With Clients', 'Communicating with clients is an important part of real estate transactions, and property buy and sell software can provide tools to help agents and brokers stay in touch with their clients throughout the process.', NULL, 1, '#087c7c', '#fff', '2023-04-12 02:21:07', '2023-04-12 02:21:07'),
(3, 'Schedule Appointments ', 'Scheduling appointments is a key part of the real estate process, and property buy and sell software can help agents and brokers manage their schedules efficiently.', NULL, 1, '#087c7c', '#fff', '2023-04-12 02:21:07', '2023-04-12 02:21:07'),
(4, 'Track Offers And Negotiations', 'Tracking offers and negotiations is an important part of real estate transactions, and property buy and sell software can provide tools to help agents and brokers stay on top of the process.', NULL, 1, '#087c7c', '#fff', '2023-04-12 02:21:07', '2023-04-12 02:21:07');
